export const columns = (vm: any) => {
  return [
    {
      title: '日期',
      width: '150px',
      fixed: 'left',
      dataIndex: 'stat_date'
    },
    {
      title: `${vm.$c('coach')}姓名`,
      fixed: 'left',
      width: '150px',
      dataIndex: 'coach_name'
    },
    {
      title: '所属部门',
      fixed: 'left',
      width: '150px',
      dataIndex: 'department_name'
    },
    {
      title: '上课节数（私）',
      dataIndex: 'personal_course_num',
      scopedSlots: { customRender: 'personal_course_num' },
      align: 'right'
    },
